import React from 'react';

export default function Sign({ documento_pdf }) {
    function setupFirmaModal(documentoId) {
        var canvas = document.getElementById('canvas' + documentoId);
        var firmaInput = document.getElementById('firma' + documentoId);
        var contexto = canvas.getContext('2d');
        var painting = false;

        canvas.addEventListener('mousedown', function (e) {
            painting = true;
            dibujar(e, canvas, firmaInput, contexto, painting);
        });

        canvas.addEventListener('mousemove', function (e) {
            if (painting) {
                dibujar(e, canvas, firmaInput, contexto, painting);
            }
        });

        canvas.addEventListener('mouseup', function () {
            painting = false;
            contexto.beginPath();
        });

        function dibujar(e, canvas, firmaInput, contexto, painting) {
            if (!painting) return;

            contexto.lineWidth = 2;
            contexto.lineCap = 'round';
            contexto.strokeStyle = '#000';

            contexto.lineTo(e.clientX - canvas.getBoundingClientRect().left, e.clientY - canvas.getBoundingClientRect().top);
            contexto.stroke();
            contexto.beginPath();
            contexto.moveTo(e.clientX - canvas.getBoundingClientRect().left, e.clientY - canvas.getBoundingClientRect().top);

            firmaInput.value = canvas.toDataURL();
        }
    }

    function limpiarFirma(documentoId) {
        var canvas = document.getElementById('canvas' + documentoId);
        var firmaInput = document.getElementById('firma' + documentoId);
        var contexto = canvas.getContext('2d');

        contexto.clearRect(0, 0, canvas.width, canvas.height);
        firmaInput.value = '';
    }

    function guardarFirma(documentoId) {
        document.forms[0].submit();
    }


  return (
    <div className="d-grid gap-2 d-flex justify-content-end">
        <div className="modal fade" id={`firmarModalDoc${documento_pdf.id}`} tabIndex="-1" role="dialog" aria-labelledby="firmarModalDocLabel" aria-hidden="true">
            <div className="modal-dialog modal-dialog-centered modal-sm" role="document">
                <div className="modal-content">
                    <div className="modal-header">
                        <h5 className="modal-title" id="firmarModalLabel">Firmar Documento</h5>
                    </div>
                    <div className="modal-body">
                        <form method="POST" onSubmit={(e) => { e.preventDefault(); guardarFirma(documento_pdf.id); }}>
                            {/* Aquí debes manejar el CSRF token de Django si es necesario */}
                            <h5>Coloca el identificador que contiene el contrato.</h5>
                            <p className="fw-medium text-muted fs-6">El nombre del identificador debe ir dentro de corchetes "[ ]"</p>
                            <input type="text" name="identificador" placeholder="Ejemplo: [Firma del cliente]" style={{ width: '100%' }} />
                            <canvas className="canvas" id={`canvas${documento_pdf.id}`} width="253" height="200"></canvas>
                            <br />
                            <input type="hidden" name="firma" id={`firma${documento_pdf.id}`} />
                            <input type="hidden" name="carpeta" value={documento_pdf.carpeta} />
                            <input type="hidden" name="documento" value={documento_pdf.nombre} />
                            <input type="hidden" name="documentoId" value={documento_pdf.id} />
                            <br />
                            <div className="d-grid gap-1 justify-content-end d-flex">
                                <button className="btn btn-primary" type="button" onClick={() => limpiarFirma(documento_pdf.id)}>Limpiar</button>
                                <button className="btn btn-secondary" type="submit" name="firmaguardar">Guardar Firma</button>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </div>
    </div>
  );
}
